import React from "react";
import "./style/_main.css";
import Header from "./components/Header";
import Home from "./components/Home";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <section className="wrapper">
        <Home />
      </section>
      <Footer />
    </div>
  );
}

export default App;
